                dt.TableName = "Reg_Configs";
                sql = @"SELECT Name as Name, Reg_Config_ID as Reg_Config_ID
                    FROM FMM_Reg_Config
                    ORDER BY Name";
                sqlparams = new SqlParameter[] { };
